void MMS4cm_pF(double *pF, const double t, const double X, const double Y, const double Z, const double *c)
{
  double c4 = c[4];
  double c5 = c[5];
  pF[0] = 1.0;
  pF[1] = 0.0;
  pF[2] = 0.0;
  pF[3] = 0.0;
  pF[4] = 1.0;
  pF[5] = 0.0;
  pF[6] = 0.0;
  pF[7] = 0.0;
  pF[8] = -X*Y*Z*c4*(X-1.0)*(Y-1.0)*(Z-1.0)*(exp(c5*t)-1.0)+1.0;
}

void MMS4cm_displacement(double *u, const double t, const double X, const double Y, const double Z, const double *c)
{
  double c0 = c[0];
  double c1 = c[1];
  double c2 = c[2];
  double c3 = c[3];
  double tU = -c3*(sqrt(2.0)*(1.0/2.0)-cos(M_PI*(1.0/4.0)-c2*t)/(c2*t+1.0));
  u[0] = -(X*X)*Y*Z*c0*tU*(Y*2.0-1.0)*pow(X-1.0,2.0)*(Y-1.0)*(Z-1.0);
  u[1] = X*(Y*Y)*Z*c0*tU*(X*2.0-1.0)*(X-1.0)*pow(Y-1.0,2.0)*(Z-1.0);
  u[2] = -X*Y*Z*c1*tU*(X-1.0)*(Y-1.0)*(Z-1.0);
}

void MMS4cm_velocity(double *v, const double t, const double X, const double Y, const double Z, const double *c)
{
  double c0 = c[0];
  double c1 = c[1];
  double c2 = c[2];
  double c3 = c[3];
  double tUt = -c3*(c2*cos(M_PI*(1.0/4.0)-c2*t)*1.0/pow(c2*t+1.0,2.0)-(c2*sin(M_PI*(1.0/4.0)-c2*t))/(c2*t+1.0));
  v[0] = -(X*X)*Y*Z*c0*tUt*(Y*2.0-1.0)*pow(X-1.0,2.0)*(Y-1.0)*(Z-1.0);
  v[1] = X*(Y*Y)*Z*c0*tUt*(X*2.0-1.0)*(X-1.0)*pow(Y-1.0,2.0)*(Z-1.0);
  v[2] = -X*Y*Z*c1*tUt*(X-1.0)*(Y-1.0)*(Z-1.0);
}

void MMS4cm_initial_velocity(double *v, const double X, const double Y, const double Z, const double *c)
{
  MMS4cm_velocity(v, 0.0, X, Y, Z, c);
}

